export function alloc ( n ) {
	return new Array( n );
}

export function argmax ( compare, a, i, j ) {

	var k, key, tmp;

	if ( i >= j ) {
		return undefined;
	}

	k = i;
	key = a[k];

	for ( ++i ; i < j ; ++i ) {

		tmp = a[i];

		if ( compare( tmp, key ) > 0 ) {
			k = i;
			key = tmp;
		}

	}

	return k;
}

export function argmin ( compare, a, i, j ) {

	var k, key, tmp;

	if ( i >= j ) {
		return undefined;
	}

	k = i;
	key = a[k];

	for ( ++i ; i < j ; ++i ) {

		tmp = a[i];

		if ( compare( tmp, key ) < 0 ) {
			k = i;
			key = tmp;
		}

	}

	return k;
}

export function copy ( a, ai, aj, b, bi ) {

	for ( ; ai < aj ; ++ai, ++bi ) {
		b[bi] = a[ai];
	}

}

export function each ( callback, array, left, right ) {

	for ( ; left < right ; ++left ) {
		callback( array[left], left, array );
	}

}

export function fill ( a, i, j, v ) {

	for ( ; i < j ; ++i ) {
		a[i] = v;
	}

}

export function fillfn ( a , i , j , fn ) {

	for ( ; i < j ; ++i ) a[i] = fn( ) ;

}

export function get ( a , i ) {
	return a[i] ;
}

