		return out;
	}

	indices = repeat( 0, r, [] );

	out.push( pick( pool, indices, [] ) );

	for ( ; ; ) {

		for ( i = r - 1 ; i >= 0 ; --i ) {
			if ( indices[i] !== len - 1 ) {
				next = indices[i] + 1;
				break;
			}
