	pool = iterable;
	len = pool.length;


	if ( repeat > len ) {
		return out;
	}


	indices = range( 0, len, 1, [] );
	cycles = range( len, len - repeat, -1, [] );

	out.push( pick( pool, indices.slice( 0, repeat ), [] ) );

	if ( repeat === 0 || len === 0 ) {
		return out;
	}

	for ( ; ; ) {

		i = repeat;

		while ( i-- ) {

